1. **Constant Folding**: This technique replaces constant expressions with their computed values at compile time.

   *Before optimization:*
   ```c
   int add(int a, int b) {
       return a + 5 + b;
   }
   ```
   *After optimization:*
   ```c
   int add(int a, int b) {
       return a + 10 + b;  // 5 + b is folded to 10 at compile time
   }
   ```

2. **Dead Code Elimination (DCE)**: DCE removes code that will never be executed or whose results are never used.

   *Before optimization:*
   ```c
   int foo(int x) {
       int y = x * 2;
       int z = y + 1;
       return z;
   }
   ```
   *After optimization:*
   ```c
   int foo(int x) {
       return x * 2 + 1;  // Variable 'y' is dead code and removed
   }
   ```

3. **Common Subexpression Elimination (CSE)**: CSE replaces multiple occurrences of the same expression with a single occurrence.

